  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
} from "react-router-dom";



export default class App extends Component {
  render() {
    return (
      <div>
        <Navbar></Navbar>
        <News pageSize = {5} country = "in" category = "science"></News>
      </div>
    )
  }
}
